import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import defaultImage from "../images/defaultImg.png"
import { Typography, CardActionArea, CardHeader, Avatar } from '@mui/material';

export default function SkillCard(props) {
    return (
        <Card sx={{ maxWidth: 200, ml: "2rem" }} className='mx-auto'>
            <CardHeader
                avatar={
                    <Avatar aria-label="recipe" src={defaultImage} />
                }
                title={props.name}
                subheader={props.level}
            />
        </Card>
    )
}
